import React from "react";
import {Box, Typography} from "@mui/material"

const StyledBox = styled(Box)({
    background: "#BFD200"
})

export default function Hero() {
    return (
        <Box>
            <StyledBox>
                <Typography variant="h1">
                    DEIN DIGITALER CO-TRAINER.
                </Typography>
            </StyledBox>

        </Box>
    )
}
